Plavanje za mladino
V to skupino sodijo otroci in mladostniki z zelo dobrim znanjem plavanja, ki ne želijo nastopati v tekmovalnih plavalnih klubih, si pa želijo celoletne vadbe pod strokovnim vodstvom učiteljev.

 Plavalna šola je namenjena rekreativnemu plavanju s poudarkom na pravilni tehniki plavanja vseh stilov. V plavalni šoli se izvaja: 
•učenje plavanja vseh tehnik (prsno, kravl, hrbtno, delfin);
•skok na glavo;
•plavanje različnih vaj z namenom izboljšave same tehnike plavanja;
•vaje za koordinacijo zavesljajev;
•pridobivanje večje vzdržljivosti.
